export default (function(a,b,c,d,e){return {data:{dJMHeAhzmS:{data:{id:1367,attributes:{imdbId:"tt0367959",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTIzMTA0NTM4NF5BMl5BanBnXkFtZTcwNjY3ODM0MQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"},{Source:"Rotten Tomatoes",Value:"16%"},{Source:"Metacritic",Value:"35\u002F100"}],item_lang:{data:{id:2030,attributes:{title:d,plot:"Mischa and Hannibal, baby brother and sister, are inseparable; it is their love for each other that ties their bond. Their companionship is forever binding, until, with their family, while hiding from the Nazi war machine a twisted set of circumstance sets the pace for a most vicious attack on the future of one Hannibal Lecter for the sworn vengeance for the brutal killing of his baby sister. Years later, we find Hannibal, the teenager, setting up in Paris, and living with his aunt Lady Murasaki Shikibu and studying at medical school here he finds his forte. Still searching for his sister's murderers, still bitter and still ever hopeful of satisfying his desire for retribution. This chance arrives, and soon we are to learn that for a pound of flesh lost a pound of flesh must be repaid. This is the horrific tale of justice and honor, a young man's growing pains that will have the guilty paying with more than just flesh and bone. This is the up and rising tale of the young Hannibal, pray you do not meet him, for meat you shall be to him. Taste his wrath.",slug:"hannibal-rising"}}},books:{data:[{id:7368,attributes:{title:d,description:"He is one of the most haunting characters in all of literature. At last the evolution of his evil is revealed. Hannibal Lecter emerges from the nightmare of the Eastern Front, a boy in the snow, mute, with a chain around his neck. He seems utterly alone, but he has brought his demons with him. Hannibal’s uncle, a noted painter, finds him in a Soviet orphanage and brings him to France, where Hannibal will live with his uncle and his uncle’s beautiful and exotic wife, Lady Murasaki. Lady Murasaki helps Hannibal to heal. With her help he flourishes, becoming the youngest person ever admitted to medical school in France. But Hannibal’s demons visit him and torment him. When he is old enough, he visits them in turn. He discovers he has gifts beyond the academic, and in that epiphany, Hannibal Lecter becomes death’s prodigy.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kYY7bge02SoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2009-06-23",publisher:e,subtitle:a}},{id:7369,attributes:{title:"Hanibal Rising",description:"Chronicles serial killer Hannibal Lecter's childhood and early adulthood after being taken from a Soviet orphanage to live with his uncle and aunt in France. He becomes the youngest person ever to attend medical school in France.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hfdOPgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2007-01-01",publisher:a,subtitle:a}},{id:7370,attributes:{title:"The Silence of the Lambs",description:"A serial murderer known only by a grotesquely apt nickname--Buffalo Bill--is stalking women. He has a purpose, but no one can fathom it, for the bodies are discovered in different states. Clarice Starling, a young trainee at the FBI Academy, is surprised to be summoned by Jack Crawford, chief of the Bureau's Behavioral Science section. Her assignment: to interview Dr. Hannibal Lecter--Hannibal the Cannibal--who is kept under close watch in the Baltimore State Hospital for the Criminally Insane. Dr. Lecter is a former psychiatrist with a grisly history, unusual tastes, and an intense curiosity about the darker corners of the mind. His intimate understanding of the killer and of Clarice herself form the core of Thomas Harris' The Silence of the Lambs--and ingenious, masterfully written book and an unforgettable classic of suspense fiction.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1d3XWXXxnEsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2009-12-28",publisher:"St. Martin's Press",subtitle:a}},{id:7371,attributes:{title:d,description:"The story of Hannibal Lecter's childhood and early years, from the mega-bestselling author of 'Hannibal' and 'The Silence of the Lambs'.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Kt6wzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2006-01-01",publisher:a,subtitle:"Book 4 - Hannibal Lecter Series"}},{id:7372,attributes:{title:"Hannibal",description:"Seven years after his escape from the authorities, Hannibal Lecter, a serial killer, is tracked down by one of his former victims using FBI agent Clarice Starling as bait, in the sequel to The Silence of the Lambs. Reissue.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FPDJr5G58YAC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2001-01-01",publisher:e,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940982426}}("","Thomas Harris",null,"Hannibal Rising","Dell"))